import React from "react";

//material-ui
import Row from "@material-ui/core/Row";
import Grid from "@material-ui/core/Grid";
import Container from "@material-ui/core/Container";

export const Main = () => {
  return (
    <div className="main">
      <React.Fragment>
        <Container
          maxWidth="md"
          style={{ backgroundColor: "lightgrey", height: "100vh" }}
        >
          <Row>
            <Grid
              item
              style={{ height: "10vh", backgroundColor: "red" }}
              md={6}
            ></Grid>
            <Grid
              item
              style={{ height: "10vh", backgroundColor: "green" }}
              md={6}
            ></Grid>
          </Row>
        </Container>
      </React.Fragment>
    </div>
  );
};
